import { useState } from "react";
import Calendar, { CalendarDayHeader } from "../components/Calendar";

const CreateEvent1 = () => {
    const [yearAndMonth, setYearAndMonth] = useState([2021, 11]);
    return (
        <div className="bg-purple-400 w-full h-screen text-center divide-y-2 ">
            <h1 className="text-white text-7xl font-bold tracking-tight pt-10 w-96">MeetUp</h1>
            <h2 className="text-yellow-300 text-4xl font-medium tracking-wide py-10">Create Event</h2>
            <h3 className="text-blue-900 text-4xl py-10">Select up to 7 days</h3>
            <Calendar
                yearAndMonth={yearAndMonth}
                onYearAndMonthChange={setYearAndMonth}
                renderDay={(calendarDayObject) => (
                    <div>
                        <CalendarDayHeader calendarDayObject={calendarDayObject} />
                    </div>
        )}
      />
        </div>
    )
}

export default CreateEvent1
